import React from 'react';
import { AppUI } from './AppUI.js';
import { AuthProvider } from './Login/peticion.js';


function App() {
  return (
    <>
    <AuthProvider>
    <AppUI></AppUI>
    </AuthProvider>
    </>
  );
}

export default App;
